import Button from "../../Button";

const Learn_Middle = ({
  title = false,
  describe = false,
  link1 = false,
  link1_label = false,
  link2 = false,
  link2_label = false,
}) => {
  if (title) {
    return (
      <section>
        <h2>{title}</h2>
        <p>{describe}</p>
        <Button to={link1} label={link1_label} outline />
        {link2 && <Button to={link2} label={link2_label} light />}
      </section>
    );
  }
};

export default Learn_Middle;
